import React from 'react';
import { Form, Button, FormGroup, FormControl, ControlLabel } from "react-bootstrap";
import Grid from 'react-bootstrap/es/Grid';
import Card from 'pnnl-react-core/lib/Card';

var options = ["1 CIE F1", "2 CIE F2", "3 CIE F3"];
const About = () => (
  <Grid>
    <br />
    <Card>
      <form>
        <label>
          User:
    <select id="user" name="user">
            <option value="one">1</option>
            <option value="two">2</option>
            <option value="three">3</option>
          </select>
        </label>
        <br />
        <label>
          Commercial:
          <select id="Commercial" name="Commercial">
            <option value="one">1</option>
            <option value="two">2</option>
            <option value="three">3</option>
          </select>
        </label>
        <br />
        <label>
          Example:
          <select id="Example" name="Example">
            <option value="1 CIE F1">1 CIE F1</option>
            <option value="1 CIE F1">2 CIE F2</option>
            <option value="1 CIE F1">3 CIE F3</option>
            {
              options.forEach((option) => {
                return <option value = {option}>{option}</option>
              })
              /*
              options.map(function(option) {
                array.forEach(element => {
                  
                });
              })
              */
            }
          </select>
        </label>
      </form>


    </Card>

  </Grid>
);

export default About;
